import React from 'react';
import { RootState } from '../store';
import { useAppSelector } from '../store/hooks';

function Asteroid() {
  const { data } = useAppSelector((state: RootState) => state.asteroid);
  return (
    <div>{data.nea}</div>
  );
}

export default Asteroid;
